// tslint:disable:variable-name
import { Component, OnInit } from '@angular/core';
import { SwUpdate } from '@angular/service-worker';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit{
  title = 'Image offline storage';

  private _image: any;
  set image(value: any) {
    this.isLoading = true;
    this.uploadedFile = document.querySelector<HTMLInputElement>('input[type=file]').files.item(0);
    const fileName: string = this.uploadedFile.name;
    this.filereader.readAsDataURL(new Blob([this.uploadedFile], {
      type: 'image',
    }));
    this.filereader.onloadend = async () => {
      this.imageData = this.filereader.result;
      const formats = await this.generateImageFormats(fileName);
      try {
        this.imageFormat = formats;
        this.formatLoaded = true;
        this.isLoading = false;
      } catch (e) {
        this.formatLoaded = false;
        this.isLoading = false;
        throw new Error(e);
      }
    };
    this._image = value;
  }

  get image(): any {
    return this._image;
  }

  private readonly imagesSize: number[] = [25, 50, 75, 100];
  private filereader: FileReader = new FileReader();

  uploadedFile: File;
  imageFormat: any[] = [];
  imageData: any;
  formatLoaded = false;
  isLoading = false;

  constructor(private swUpdate: SwUpdate) {
  }

  ngOnInit(): void {
    // tslint:disable-next-line:max-line-length
    localStorage.setItem('cached-image', 'data:image/jpeg;base64,');

    if (this.swUpdate.isEnabled) {
      this.swUpdate.available.subscribe(() => {
        if (confirm('New version available. Load newest version?')) {
          window.location.reload();
        }
      });
    }
  }

  async generateImageFormats(name: string): Promise<any[]> {
    return new Promise((resolve, reject) => {
      const img = new Image();
      img.src = this.imageData;
      img.onload = () => {
        resolve(this.imagesSize.map((e) => {
          const width = img.width / 100 * e;
          const height = img.height / 100 * e;
          return {
            name,
            height,
            width,
            size: `${e}%`,
            data: this.imageToDataUri(img, width, height),
          };
        }));
      };
    });
  }

  imageToDataUri(img: any, width: number, height: number): any {
    const canvas: HTMLCanvasElement = document.createElement('canvas');
    const ctx = canvas.getContext('2d');

    canvas.width = width;
    canvas.height = height;

    ctx.drawImage(img, 0, 0, width, height);

    return canvas.toDataURL();
  }

  async getImageFromCache(): Promise<void> {
    this.imageData = localStorage.getItem('cached-image');
    const formats = await this.generateImageFormats('Cached image');
    try {
      this.imageFormat = formats;
      this.formatLoaded = true;
      this.isLoading = false;
    } catch (e) {
      this.formatLoaded = false;
      this.isLoading = false;
      throw new Error(e);
    }
  }
}
